import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import './navbar.css'

class NavBar extends Component{
  state = {
    klassDropdown: false
  }


  handleKlassDropdownClick = () => {
    this.setState({
      ...this.state,
      klassDropdown: !this.state.klassDropdown
    })
  }

  renderKlassDropdown = () => {
    return (
      <div className="klass-dropdown-menu">
        HEY HEY
      </div>
    )
  }

  render(){
    return (
      <div className="navbar">
        <div className="navbar-buttons">
          <NavLink to="/">Home</NavLink>
          <NavLink to="/classes">Classes Index</NavLink>
          <div className="klass-dropdown" onClick={this.handleKlassDropdownClick}>
            Classes Dropdown
          </div>
          <NavLink to="/progressions/new">New Progression</NavLink>
          <NavLink to="/progressions">All Progressions</NavLink>
        </div>
        <div className="navbar-dropdowns">
          {this.state.klassDropdown ? this.renderKlassDropdown() : ''}
        </div>
      </div>
    )
  }

}

export default NavBar
